SELECT ?prodiBirthName ?prodiParty ?fatherParty WHERE {
  # Get Romano Prodi's birth name and party
  ?prodi a dbo:Person ;
         foaf:name "Romano Prodi" ;
         dbo:birthName ?prodiBirthName ;
         dbo:party ?prodiParty .

  # Get an alumnus of MIT and their father's political party
  ?alumnus a dbo:Person ;
           dbo:alumni <http://dbpedia.org/resource/Massachusetts_Institute_of_Technology> ;
           dbo:father ?father .

  ?father a dbo:Person ;
          dbo:party ?fatherParty .
}

