SELECT ?child ?spouse ?parentOfCommanderChild WHERE {
  # Find Antiochus III the Great
  ?antiochus a dbo:Person ;
              rdfs:label "Antiochus III the Great"@en ;
              dbo:child ?child .

  # Find the spouse of the child
  ?child dbo:spouse ?spouse .

