SELECT ?grandparent ?childOfMargaret ?childOfJoseph
WHERE {
  # Find Archduchess Margaret of Austria
  ?margaret a dbo:Person ;
            foaf:name "Archduchess Margaret of Austria"@en ;
            dbo:parent ?parentMargaret .

  # Find the child of Archduchess Margaret
  ?parentMargaret dbo:child ?childOfMargaret .

  # Find the parent of that child
  ?grandparent foaf:child ?childOfMargaret .

  # Find Archduke Joseph August of Austria
  ?joseph a dbo:Person ;
           foaf:name "Archduke Joseph August of Austria"@en ;
           dbo:child ?childOfJoseph .
}
